    public function run()
    {
        MasterGuide::insert([
            ["id_guide" => 1, "id_guide_parent" => 0, "flag_active" => "Y", "nav_title" => "Overview", "title" => "Sekilas mengenai aplikasi Confess", "slug" => "overview", "url" => "overview", "reading_time" => 66, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Dalam menjalankan aplikasi Confess, kita sangat merekomendasikan untuk mengawali pengalaman kamu dengan memahami gambaran keseluruhan. Confess adalah teman setia yang membuka ruang bagimu untuk menyuarakan pendapat, mencurahkan hati, atau menyampaikan laporan tanpa beban. Dengan antarmuka tampilan yang ramah pengguna, aplikasi ini memungkinkan kamu berinteraksi dengan lingkungan sekolah secara aman dan transparan. Jadi, pastikan kamu memahami secara keseluruhan bagaimana Confess dapat menjadi mempercepat pengalamanmu di dunia digital sekolah, ya. Dengan fitur-fitur inovatifnya, seperti privasi atau anonimitas saat membuat laporan, Confess memberikan kebebasan kepada penggunanya untuk berbicara tanpa takut!</p><p>Lebih dari sekadar alat pelaporan, Confess menjadi sarana untuk membangun kepercayaan antara siswa dan pihak sekolah. Dengan memberikan opsi privasi atau anonimitas, aplikasi ini menciptakan lingkungan yang mendukung bagi kamu yang mungkin merasa ragu untuk melaporkan kejadian atau menyampaikan masalah. Selain itu, antarmuka yang <em>user-friendly</em> menjadikan proses <em>register</em> dan <em>log-in</em> semakin mudah, sehingga setiap pengguna dapat dengan cepat merasakan manfaat dari aplikasi ini. Dengan Confess, kita berharap dapat melihat terbentuknya komunitas sekolah yang lebih inklusif, peduli, dan berkomunikasi secara terbuka demi kebaikan bersama. Melalui penggunaan aplikasi ini, diharapkan juga muncul kolaborasi yang erat antara siswa, guru, dan pihak sekolah untuk menciptakan lingkungan belajar yang lebih positif dan membangun karakter. Dengan demikian, Confess tidak hanya menjadi sarana pelaporan, tetapi juga menjadi jembatan untuk memperkuat koneksi antaranggota komunitas sekolah dalam perjalanan pendidikan yang lebih bermakna~!</p>'],
            ["id_guide" => 2, "id_guide_parent" => 0, "flag_active" => "Y", "nav_title" => "Rekomendasi", "title" => "", "slug" => "rekomendasi", "url" => "rekomendasi", "reading_time" => 0, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => ''],
            ["id_guide" => 3, "id_guide_parent" => 2, "flag_active" => "Y", "nav_title" => "Overview", "title" => "Rekomendasi untuk mengakomodasi penggunaan aplikasi", "slug" => "overview-rekomendasi", "url" => "rekomendasi/overview-rekomendasi", "reading_time" => 34, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Untuk dapat merasakan pengalaman optimal dengan aplikasi, ada beberapa prasyarat yang perlu dipenuhi sebelum memulai. Pertama-tama, pastikan kamu menggunakan <em>browser</em> terkini, seperti Firefox, Safari, atau Chrome, untuk memastikan kompatibilitas dan kinerja yang baik. Dengan <em>browser</em> yang diperbarui, kamu akan dapat menikmati tampilan yang responsif dan fungsi-fitur terbaru yang disajikan oleh aplikasi ini.</p><p>Selain itu, <em>device</em> yang kamu gunakan juga memainkan peran penting. Pastikan <em>device</em> yang digunakan memiliki koneksi internet yang stabil untuk menghindari gangguan saat melakukan eksplorasi. Aplikasi ini dirancang untuk mendukung berbagai <em>device,</em> baik itu laptop, tablet, atau smartphone, sehingga pengguna dapat mengaksesnya dengan mudah dari manapun dan kapanpun. Dengan memenuhi kedua prasyarat ini, pengguna dapat menikmati aplikasi dengan lancar dan tanpa hambatan teknis.</p>'],
            ["id_guide" => 4, "id_guide_parent" => 2, "flag_active" => "Y", "nav_title" => "Browser", "title" => "", "slug" => "browser", "url" => "rekomendasi/browser", "reading_time" => 0, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => ''],
            ["id_guide" => 5, "id_guide_parent" => 4, "flag_active" => "Y", "nav_title" => "Overview", "title" => "Gambaran umum mengenai browser", "slug" => "overview-browser", "url" => "rekomendasi/browser/overview-browser", "reading_time" => 42, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Kamu akan mendapatkan sedikit wawasan umum tentang penggunaan berbagai <em>browser</em> saat mengakses aplikasi. Browser, sebagai perangkat lunak yang memfasilitasi interaksi pengguna dengan internet, memainkan peran kunci dalam pengalaman pengguna dengan aplikasi. Mozilla Firefox, Safari, dan Google Chrome adalah beberapa <em>browser</em> yang direkomendasikan untuk mendapatkan pengalaman terbaik dengan aplikasi ini.</p><p>Sebagai langkah awal, pastikan <em>browser</em> kamu selalu diperbarui ke versi terbaru. Pembaruan ini tidak hanya membawa peningkatan keamanan, tetapi juga memastikan kompatibilitas dengan fitur-fitur terkini yang mungkin diperlukan oleh aplikasi. <em>Browser</em> yang diperbarui juga membantu meminimalkan risiko kerentanan keamanan, sehingga kamu dapat menjelajahi aplikasi dengan lebih aman dan nyaman. Selain itu, perhatikan pengaturan privasi dan keamanan di <em>browser</em> untuk menyesuaikannya dengan preferensi pribadi. Pastikan bahwa opsi seperti <em>cookies</em> dan <em>pop-up</em> diatur sesuai keinginan untuk mendukung pengalaman pengguna yang optimal. Dengan langkah-langkah ini, dapat dipastikan kalau kamu siap menyajikan cerita tanpa gangguan.</p>'],
            ["id_guide" => 6, "id_guide_parent" => 4, "flag_active" => "Y", "nav_title" => "Firefox", "title" => "Browser Firefox", "slug" => "firefox", "url" => "rekomendasi/browser/firefox", "reading_time" => 10, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Untuk pengguna Firefox, pastikan <em>browser</em> kamu diperbarui ke versi terbaru untuk mengoptimalkan pengalaman yang akan kamu rasakan. Fitur-fitur terkini dan keamanan tambahan yang diperbarui pada Firefox akan memastikan kenyamanan dan keamanan saat menjelajahi aplikasi.</p>'],
            ["id_guide" => 7, "id_guide_parent" => 4, "flag_active" => "Y", "nav_title" => "Safari", "title" => "Browser Safari", "slug" => "safari", "url" => "rekomendasi/browser/safari", "reading_time" => 7, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Pengguna Safari dapat memastikan kenyamanan penggunaan dengan memastikan <em>browser</em> selalu ter-<em>update.</em> Safari memberikan dukungan yang baik terhadap aplikasi ini, memastikan responsivitas dan kestabilan saat menjelajahi aplikasi.</p>'],
            ["id_guide" => 8, "id_guide_parent" => 4, "flag_active" => "Y", "nav_title" => "Chrome", "title" => "Browser Chrome", "slug" => "chrome", "url" => "rekomendasi/browser/chrome", "reading_time" => 9, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Bagi pengguna Google Chrome, aplikasi ini akan berjalan dengan baik pada versi terbaru <em>browser</em> ini. Chrome dikenal dengan kecepatan dan ketersediaan fitur-fitur terkini dan dapat menikmati aplikasi dengan lancar dan tanpa hambatan.</p>'],
            ["id_guide" => 9, "id_guide_parent" => 2, "flag_active" => "Y", "nav_title" => "Device", "title" => "", "slug" => "device", "url" => "rekomendasi/device", "reading_time" => 0, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => ''],
            ["id_guide" => 10, "id_guide_parent" => 9, "flag_active" => "Y", "nav_title" => "Overview", "title" => "Macam-macam device", "slug" => "overview-device", "url" => "rekomendasi/device/overview-device", "reading_time" => 60, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Aplikasi ini dirancang untuk memberikan pengalaman yang responsif dan konsisten, baik digunakan di laptop, tablet, atau smartphone. Keberagaman perangkat yang didukung memberikan fleksibilitas kepada pengguna untuk mengakses Confess dari manapun dan kapanpun sesuai kebutuhan.</p><p>Pertama-tama, pastikan perangkat yang kamu gunakan memiliki koneksi internet yang stabil. Koneksi yang baik akan memastikan kamu dapat menjelajahi <em>confess</em> tanpa gangguan atau keterlambatan yang tidak diinginkan. Hal ini khususnya penting saat kamu ingin berbagi <em>confess</em> kamu sendiri atau memberikan tanggapan secara <em>real-time</em>. Selain itu, perhatikan kapasitas penyimpanan perangkatmu, terutama jika kamu berniat untuk mengunggah gambar atau <em>file</em> pendukung lainnya. Hal ini membantu mencegah terhambatnya fungsi aplikasi akibat keterbatasan ruang penyimpanan.</p><p>Perangkat yang dilengkapi dengan layar resolusi tinggi juga dapat meningkatkan kualitas visual saat membaca berbagi <em>confessions</em>. Dengan layar yang jernih, kamu dapat lebih menikmati pengalaman membaca dan berkontribusi dalam Confess. Pastikan juga untuk menjaga keamanan perangkatmu dengan menginstal pembaruan sistem operasi dan aplikasi terbaru untuk memastikan kinerja yang optimal dan perlindungan terhadap potensi risiko keamanan. Dengan memahami karakteristik perangkat yang kamu gunakan, kamu dapat merasakan pengalaman Confess yang lebih memuaskan dan sesuai dengan preferensi kamu.</p>'],
            ["id_guide" => 11, "id_guide_parent" => 9, "flag_active" => "Y", "nav_title" => "Laptop", "title" => "Memakai laptop untuk visualisasi yang lebih baik", "slug" => "laptop", "url" => "rekomendasi/device/laptop", "reading_time" => 60, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Saat menggunakan aplikasi Confess di laptop, pastikan <em>device</em> yang kamu gunakan memiliki <em>browser</em> yang diperbarui untuk memastikan kompatibilitas dan performa yang optimal. Pilihan seperti Mozilla Firefox, Safari, atau Google Chrome sangat direkomendasikan untuk memaksimalkan pengalaman eksplorasi. Jangan lupa untuk memastikan juga koneksi internetmu tetap stabil agar terhindar dari potensi gangguan saat menjelajahi pengakuan atau berpartisipasi dalam interaksi di dalam aplikasi.</p><p>Layar laptop yang besar dan memiliki resolusi tinggi dapat meningkatkan kenyamanan membaca dan memberikan pengalaman visual yang lebih baik. Pastikan layar laptopmu bersih dan terang sebelum mengakses Confess untuk memastikan kualitas visual yang optimal. Selain itu, laptop memberikan kemudahan dalam mengetik pengakuan atau tanggapan yang lebih panjang, memungkinkan pengguna untuk mengekspresikan diri secara lebih rinci.</p><p>Jangan lupakan pentingnya menjaga keamanan laptop dengan melakukan pembaruan sistem operasi dan <em>software</em> antivirus secara teratur. Hal ini membantu melindungi data pribadi dan menjaga kestabilan sistem saat menggunakan aplikasi Confess. Dengan memahami karakteristik dan kebutuhan laptop yang kamu miliki, kamu dapat mengoptimalkan pengalaman yang kamu dapatkan di dalam Confess tanpa hambatan teknis.</p><p><br></p><p><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Dashboard dengan Ukuran Laptop</em></strong></p>'],
            ["id_guide" => 12, "id_guide_parent" => 9, "flag_active" => "Y", "nav_title" => "Tablet", "title" => "Fleksibilitas layar sentuh dengan device tablet", "slug" => "tablet", "url" => "rekomendasi/device/tablet", "reading_time" => 48, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Saat menggunakan aplikasi Confess di tablet, kamu akan merasakan kenyamanan dan portabilitas yang memungkinkan akses ke <em>platform</em> ini dengan mudah dan nyaman di berbagai tempat. Pastikan tablet kamu dilengkapi dengan <em>browser</em> terkini, seperti Mozilla Firefox, Safari, atau Google Chrome, untuk mendukung pengalaman pengguna yang lancar. Layar sentuh tablet memberikan fleksibilitas dalam menjelajahi <em>confessions</em> dan berinteraksi dengan aplikasi dengan sentuhan langsung.</p><p>Ukuran layar tablet yang sederhana dapat memberikan kombinasi yang baik antara kenyamanan membaca dan portabilitas. Kamu dapat dengan mudah menyelusuri <em>confessions</em> menarik dengan menggeser layar atau menyentuh elemen tertentu. Tablet juga memfasilitasi kemudahan dalam mengetik <em>confess</em> atau memberikan tanggapan singkat, memberikan pengalaman yang interaktif dan responsif.</p><p>Penting untuk memastikan koneksi internetmu stabil agar kamu dapat mengakses Confess tanpa kendala. Juga, pastikan untuk menjaga keamanan tablet kamu dengan mengaktifkan pembaruan sistem operasi dan aplikasi secara rutin. Dengan memahami karakteristik tablet yang kamu gunakan, kamu dapat menjelajahi dan berpartisipasi dalam aplikasi Confess dengan cara yang praktis dan menyenangkan.</p><p><br></p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Dashboard dengan Ukuran Tablet</em></strong></p>'],
            ["id_guide" => 13, "id_guide_parent" => 9, "flag_active" => "Y", "nav_title" => "Smartphone", "title" => "Memudahkan portabilitas dengan smartphone", "slug" => "smartphone", "url" => "rekomendasi/device/smartphone", "reading_time" => 42, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Aplikasi Confess dapat diakses dengan mudah melalui smartphone, memberikan pengguna kemampuan untuk berpartisipasi dalam aplikasi tanpa batasan ruang dan waktu. Pastikan smartphone kamu dilengkapi dengan <em>browser</em> terkini, seperti Mozilla Firefox, Safari, atau Google Chrome, untuk mendukung pengalaman yang responsif. Layar sentuh pada smartphone mempermudah navigasi, memungkinkan kamu untuk dengan cepat menjelajahi <em>confessions</em> atau memberikan tanggapan secara intuitif.</p><p>Ukuran layar smartphone yang lebih kecil dibandingkan dengan laptop atau tablet membuatnya ideal untuk penggunaan sambil bepergian. Kamu dapat membaca atau berbagi <em>confess</em> dengan mudah tanpa harus membawa perangkat yang besar.</p><p>Penting untuk memastikan koneksi internet yang stabil agar kamu dapat mengakses Confess tanpa hambatan. Terakhir, pastikan smartphone kamu dalam kondisi keamanan dengan memperbarui sistem operasi dan aplikasi secara teratur. Dengan memahami fitur dan keterbatasan smartphone, kamu dapat mengakses Confess dengan mudah dan tetap terhubung dengan aplikasi di mana pun kamu berada.</p><p><br></p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Dashboard dengan Ukuran Smartphone</em></strong></p>'],
            ["id_guide" => 14, "id_guide_parent" => 0, "flag_active" => "Y", "nav_title" => "Akun", "title" => "", "slug" => "akun", "url" => "akun", "reading_time" => 0, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => ''],
            ["id_guide" => 15, "id_guide_parent" => 14, "flag_active" => "Y", "nav_title" => "Overview", "title" => "Akun: registrasi dan login", "slug" => "overview-akun", "url" => "akun/overview-akun", "reading_time" => 11, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Sebuah akun berguna untuk kamu melakukan autentikasi terhadap aplikasi Confess. Untuk memiiliki akun, kamu bisa melakukan registrasi terlebih dahulu. Setelah melakukan registrasi dan akun berhasil diaktifkan, maka akun kamu siap untuk melakukan <em>log-in</em> dan melakukan eksplorasi pada aplikasi.</p>'],
            ["id_guide" => 16, "id_guide_parent" => 14, "flag_active" => "Y", "nav_title" => "Registrasi", "title" => "Melakukan registrasi akun", "slug" => "registrasi", "url" => "akun/registrasi", "reading_time" => 13, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Untuk bisa melakukan registrasi sebuah akun, kamu bisa menghubungi admin, ya. Dalam hal ini, kamu bisa menghubungi kepala sekolah.</p><p><br></p><p>Ketika membuat akun, kamu akan disuguhkan beberapa data yang harus diisi:</p><ul><li>Nama lengkap;</li><li>NIK;</li><li>Username;</li><li>Email;</li><li>Password;</li><li>Jenis kelamin;</li><li>Role;</li><li>dan NIP/NISN.</li></ul><p><br></p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Halaman Registrasi Pengguna</em></strong></p>'],
            ["id_guide" => 17, "id_guide_parent" => 14, "flag_active" => "Y", "nav_title" => "Login", "title" => "Autentikasi log-in dengan akun", "slug" => "login", "url" => "akun/login", "reading_time" => 11, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Jika sudah melakukan registrasi akun, maka setelahnya kamu bisa melakukan autentikasi, yaitu <em>log-in</em>, ke dalam aplikasi. Silakan kamu memasukkan <em>credentials</em> berupa <em>username</em> dan <em>password</em> di <em>form</em> dan kolom yang tersedia. Selanjutnya tinggal klik "Masuk".</p><p><br></p><p><img src="data:image/png;base64,"></p><p><br></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Halaman Login untuk Melakukan Autentikasi</em></strong></p><p><br></p>'],
            ["id_guide" => 18, "id_guide_parent" => 0, "flag_active" => "Y", "nav_title" => "Roles", "title" => "", "slug" => "roles", "url" => "roles", "reading_time" => 0, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => ''],
            ["id_guide" => 19, "id_guide_parent" => 18, "flag_active" => "Y", "nav_title" => "Overview", "title" => "Roles yang ada dalam aplikasi Confess", "slug" => "overview-roles", "url" => "roles/overview-roles", "reading_time" => 19, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Setidaknya ada 3 <em>roles</em> yang terlibat dalam aplikasi Confess, yaitu <em>student</em>, <em>officer</em>, dan <em>admin</em>. <em>Roles</em> berguna untuk memisahkan kemampuan masing-masing pengguna. Misalnya, pengguna dengan role student, ia bisa membuat laporan atau <em>confess</em>. Lalu pengguna dengan <em>role officer</em>, maka bisa menanggapi <em>confess</em> yang sudah dibuat oleh <em>student</em>. Sementara pengguna dengan <em>role admin</em> akan memantau kegiatan-kegiatan yang dilakukan oleh <em>students</em> dan <em>officers</em>.</p><p><br></p><p class="ql-align-center"><img src="//:0"><img src="data:image/jpeg;base64,"></p><p class="ql-align-center"><br></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Confess\' Roles: Student, Officer, and Admin<br></em></strong></p>'],
            ["id_guide" => 20, "id_guide_parent" => 18, "flag_active" => "Y", "nav_title" => "Student", "title" => "Features yang dimiliki oleh pengguna dengan role Student", "slug" => "student", "url" => "roles/student", "reading_time" => 13, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Berikut adalah daftar dari <em>abilities</em> atau <em>features</em> yang dimiliki oleh pengguna dengan <em>role Student</em>:</p><ul><li><em>Dashboard statistics</em>;</li><li>Riwayat <em>log-in</em> (statistik);</li><li>Membuat <em>confessions</em>;</li><li>Memberikan <em>responses</em> pada <em>confess</em> yang sudah dibuat olehnya;</li><li>Memberi <em>comments </em>terhadap sebuah <em>confess</em> di bagian <em>home page</em>;</li><li>dan mengganti <em>username</em>, <em>email</em>, dan <em>password.</em></li></ul><p><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong><em>Student\'s Dashboard</em></strong></p>'],
            ["id_guide" => 21, "id_guide_parent" => 18, "flag_active" => "Y", "nav_title" => "Officer", "title" => "Abilities dari akun dengan role Officer", "slug" => "officer", "url" => "roles/officer", "reading_time" => 13, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Berikut adalah daftar dari <em>abilities</em> atau <em>features</em> yang dimiliki oleh pengguna dengan <em>role Officer</em>:</p><ul><li><em>Dashboard statistics</em>;</li><li>Riwayat <em>log-in</em> (statistik);</li><li>Memberikan <em>responses</em> pada suatu <em>confess</em> di bagian <em>dashboard</em>;</li><li>Memberikan <em>comments</em> terhadap sebuah <em>confess</em> di bagian <em>home page</em>;</li><li>dan mengganti <em>username</em>, <em>email</em>, dan <em>password</em>.</li></ul><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong><em>Officer\'s Dashboard</em></strong></p>'],
            ["id_guide" => 22, "id_guide_parent" => 18, "flag_active" => "Y", "nav_title" => "Admin", "title" => "Role Admin dengan full control", "slug" => "admin", "url" => "roles/admin", "reading_time" => 18, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Berikut adalah daftar dari <em>abilities</em> atau <em>features</em> yang dimiliki oleh pengguna dengan <em>role Admin</em>:</p><ul><li><em>Dashboard statistics</em>;</li><li>Riwayat <em>log-in</em> (statistik dan data);</li><li>Memberikan <em>comments</em> terhadap sebuah <em>confess</em> di bagian <em>home page</em>;</li><li>Memantau <em>confessions</em>, <em>responses</em>, <em>comments</em>, dan <em>likes</em>;</li><li>Mengelola kategori <em>confession</em>;</li><li>Mengelola <em>users</em>: registrasi, <em>update</em>, nonaktif, dan mengaktifkan akun;</li><li>Mengganti nama lengkap, NIK, NIP, <em>username</em>, <em>email</em>, dan <em>password</em>;</li><li>dan menonaktifkan akunnya sendiri.</li></ul><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong><em>Admin\'s Dashboard</em></strong></p>'],
            ["id_guide" => 23, "id_guide_parent" => 0, "flag_active" => "Y", "nav_title" => "Fitur", "title" => "", "slug" => "fitur", "url" => "fitur", "reading_time" => 0, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => ''],
            ["id_guide" => 24, "id_guide_parent" => 23, "flag_active" => "Y", "nav_title" => "Overview", "title" => "Penggunaan dasar dari aplikasi Confess beserta features-nya", "slug" => "overview-fitur", "url" => "overview/overview-fitur", "reading_time" => 19, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Confess menyediakan <em>features</em> yang akan memudahkan pengguna melakukan interaksi dengan aplikasi. Berikut adalah beberapa <em>features</em> yang ada pada aplikasi Confess:</p><ul><li>Laporan atau bisa kamu sebut dengan <em>confession</em>;</li><li>Tanggapan atau bisa kamu sebut dengan <em>response</em>;</li><li>Komentar atau bisa kamu sebut dengan <em>comment</em>;</li><li>Kategori pengakuan atau bisa kamu sebut dengan <em>confession\'s category</em>;</li><li>Suka atau bisa kamu sebut dengan <em>like</em>;</li><li>Pengelolaan akun;</li><li>Riwayat <em>log-in</em>;</li><li>Pengaturan <em>website</em>;</li><li>dan panduan aplikasi.</li></ul>'],
            ["id_guide" => 25, "id_guide_parent" => 23, "flag_active" => "Y", "nav_title" => "Confession", "title" => "Fitur confession", "slug" => "confession", "url" => "fitur/confession", "reading_time" => 120, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<h3><span class="ql-font-serif">Student</span></h3><p>Ketika <em>student</em> ingin menyampaikan cerita, keluhan, laporan, kritik, saran atau <em>confess</em>, maka ia diharuskan untuk menggunakan fitur <em>confession</em>. Berikut adalah contohnya:</p><p>Pengguna Surya Nata dengan <em>role student</em> membuat <em>confess</em> yang ingin disampaikannya. Selanjutnya ia harus ke <em>sidebar</em> lalu pilih bagian "Pengakuan". Pada menu "Pengakuan", di sana akan tersedia daftar <em>confessions</em> yang sudah dibuat oleh pengguna Surya Nata. Jika ingin membuat <em>confessions</em> yang lainnya, maka berikutnya klik tombol "Buat Pengakuan".</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong><em>Tampilan Menu Pengakuan: Student</em></strong></p><p><br></p><p>Setelah klik tombol "Buat Pengakuan", maka pengguna Surya Nata diharuskan untuk mengisi sebuah <em>form</em>, berkaitan dengan <em>confess</em> yang ingin disampaikannya. Dalam <em>form</em> tersebut, ada beberapa <em>input</em> yang harus diisi, yaitu:</p><ul><li>Judul pengakuan</li></ul><p class="ql-indent-1"><em>Title</em> atau judul <em>confession</em> yang ingin disampaikan.</p><ul><li>Slug</li></ul><p class="ql-indent-1">Berguna untuk nama URL<em> confession</em>.</p><ul><li>Tanggal kejadian</li></ul><p class="ql-indent-1">Waktu kejadian yang dialami oleh pelapor.</p><ul><li>Kategori pengakuan</li></ul><p class="ql-indent-1"><em>Confession\'s category</em> untuk menentukan kategori <em>confession</em>.</p><ul><li>Kerahasiaan pengakuan</li></ul><p class="ql-indent-1">Privasi dari <em>confession</em>: publik atau anonim.</p><ul><li>Isi pengakuan</li></ul><p class="ql-indent-1">Tuliskan kejadian apa yang dialami dan apa yang dirasakan..</p><p><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Form Pengakuan</em></strong></p><p><br></p><p>Kalau semua data sudah diisi, klik tombol "Submit". Maka <em>confess</em> dari Surya Nata sudah berhasil dibuat.</p><p><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Confession</em></strong></p><p><br></p><p>Note:</p><p>Apa yang dimaksud dengan "Kerahasiaan Pengakuan" adalah, jika "Publik" maka identitas dari pelapor akan ditampilkan secara keseluruhan di bagian <em>home page</em>.</p><p><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Kerahasiaan Pengakuan: Publik</em></strong></p><p><br></p><p>Sebaliknya, jika "Anonim" maka identitas dari pelapor akan disembunyikan.</p><p><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Kerahasiaan Pengakuan: Anonim</em></strong></p><p><br></p><h3><span class="ql-font-serif">Officer</span></h3><p>Untuk pengguna dengan <em>role Officer</em>, ketika ia mengakses fitur Pengakuan (<em>confession</em>) di <em>sidebar</em>, maka tampilannya akan berbeda dengan <em>student</em>. Di sana, <em>officer</em> bisa melakukan <em>handling</em> terhadap sebuah <em>confess</em>. Ia bisa <em>takeover</em>, <em>release</em>, dan <em>close</em> sebuah <em>confession</em>. Ada beberapa tables yang tersedia:</p><ul><li><em>All of Confessions</em></li></ul><p>Menampilkan seluruh <em>confessions</em> yang sudah dibuat oleh <em>student</em>.</p><ul><li><em>Confessions Handled by You</em></li></ul><p>Menampilkan <em>confessions</em> yang di-<em>handle</em> oleh seorang <em>officer</em>.</p><ul><li><em>Unprocessed Confessions</em></li></ul><p>Menampilkan <em>confessions</em> yang belum diproses atau di-<em>handle</em>.</p><p><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Tampilan Menu Pengakuan: Officer</em></strong></p><p><br></p><p>Misalnya <em>officer</em>, dengan nama Moepoi, akan melakukan <em>takeover</em> pada sebuah <em>confess</em> dengan judul "Sering Ditindas Karena Hobinya Unik". Maka cukup dengan klik tombol centang. Setelahnya, confess sudah di-<em>handle</em> oleh <em>officer</em> Moepoi.</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Assigned To: Officer</em></strong></p><p><br></p><p>Seandainya <em>officer</em> Moepoi tidak bisa menindaklanjuti <em>confess</em> tersebut lebih lanjut, maka <em>officer</em> bisa melakukan <em>release</em> dengan cara mengklik tombol berwarna abu-abu atau dengan mengganti status ketika ingin memberikan <em>response</em>. Lalu, jika sekiranya <em>confess</em> sudah selesai ditangani, maka <em>officer</em> bisa memberikan <em>response</em> sambil dengan mengganti status <em>confess</em>-nya.</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Tombol Action: Release dan Close</em></strong></p><p><br></p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Status: Process, Release, dan Close</em></strong></p><p><br></p><h3><span class="ql-font-serif">Admin</span></h3><p>Sementara pengguna dengan <em>role admin</em> hanya bisa memantau kegiatan-kegiatan yang dilakukan oleh <em>officers</em> dan <em>students</em>.</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Tampilan Menu Pengakuan: Admin</em></strong></p>'],
            ["id_guide" => 26, "id_guide_parent" => 23, "flag_active" => "Y", "nav_title" => "Response", "title" => "Fitur response", "slug" => "response", "url" => "fitur/response", "reading_time" => 27, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<h3><span class="ql-font-serif">Student</span></h3><p>Setelah <em>student</em> Surya Nata membuat <em>confess</em>-nya, maka ia bisa memberikan tanggapan atau <em>response</em> terhadap <em>confess</em> tersebut.</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Responses</em></strong></p><p><br></p><p>Perlu diperhatikan bahwa <em>student</em> bisa melakukan <em>edit</em> dan <em>unsend</em> tanggapan hanya ketika <em>confess</em> tersebut belum <em>assigned</em>. Jika sudah <em>assigned</em>, maka student tidak bisa melakukan sunting dan hapus <em>response</em>.</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Assigned To</em></strong></p><p><br></p><h3><span class="ql-font-serif">Officer</span></h3><p>Ketika sebuah <em>confess</em> sudah di-<em>pick</em> dan di-<em>handle</em> olehnya, maka <em>officer</em> baru bisa memberikan tanggapan atau <em>response</em> terhadap <em>confess</em> tersebut. Jika tidak, maka officer tidak bisa memberikan <em>responses</em> apapun.</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Unassign</em></strong></p><p><br></p><h3><span class="ql-font-serif">Admin</span></h3><p>Sementara pengguna dengan <em>role admin</em> hanya bisa memantau kegiatan-kegiatan yang dilakukan oleh <em>officers</em> dan <em>students</em>.</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong class="ql-font-monospace"><em>Tampilan Menu Tanggapan: Admin<br></em></strong></p>'],
            ["id_guide" => 27, "id_guide_parent" => 23, "flag_active" => "Y", "nav_title" => "Comment", "title" => "Fitur comment", "slug" => "comment", "url" => "fitur/comment", "reading_time" => 9, "created_at" => now(), "updated_at" => now(), "created_by" => 1, "body" => '<p>Berbeda dengan fitur <em>response</em> yang hanya bisa dilakukan secara <em>one-by-one</em> oleh <em>student</em> dan <em>officer</em> yang bersangkutan, fitur comment ini tersedia untuk semua pengguna. Fitur ini bisa diakses di bagian <em>landing page</em>.</p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p class="ql-align-center"><strong><em>Comment</em></strong></p>'],
        ]);
    }
}